import React from "react";
import "./customButton.style.scss";

const CustomButton = ({ children, isGoogleSignIn, ...otherProps }) => (
  <button className={isGoogleSignIn ? "google-sign-in" : " "} {...otherProps}>
    {children}
  </button>
);

export default CustomButton;
